}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">  <g>    <polygon points="2 8 4 8 4 4 8 4 8 2 2 2 2 8" fill="#fff"/>    <polygon points="20 20 16 20 16 22 22 22 22 16 20 16 20 20" fill="#fff"/>    <polygon points="4 16 2 16 2 22 8 22 8 20 4 20 4 16" fill="#fff"/>    <polygon points="16 2 16 4 20 4 20 8 22 8 22 2 16 2" class="aw-theme-iconOutline" fill="#fff"/>  </g></svg>';
